<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <meta http-equiv="X-UA-Compatible" content="ie=edge">
  <link href="https://fonts.googleapis.com/css?family=Poppins&display=swap" rel="stylesheet">
  <link rel="stylesheet" href="css/bootstrap.css">
  <link rel="stylesheet" href="/css/dashboard.css">
  <link rel="stylesheet" href="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/css/bootstrap.min.css" integrity="sha384-ggOyR0iXCbMQv3Xipma34MD+dH/1fQ784/j6cY/iJTQUOhcWr7x9JvoRxT2MZw1T" crossorigin="anonymous">
  <title>Document</title>
</head>

<body>
  <header>
    <nav class="navbar navbar-expand-lg navbar-light" id="nav">
      <div class="logo">
          <a class="navbar-brand" href="#">Teachers Dashboard</a>
          <a href="#"><img src="/images/Logo.png" alt=""></a>
      </div>
      <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
        <span class="navbar-toggler-icon"></span>
      </button>
    
      <div class="collapse navbar-collapse" id="navbarSupportedContent">
        <ul class="navbar-nav mr-auto">
          <li class="nav-item active">
            <div class="active-bar"></div>
            <a class="nav-link current" href="#">Home <span class="sr-only">(current)</span></a>
          </li>
          <li class="nav-item">
            <a class="nav-link" href="#">Class Note</a>
          </li>
          <li class="nav-item">
            <a class="nav-link" href="#">Assignment</a>
          </li>
          <li class="nav-item">
              <a class="nav-link" href="#">Subject</a>
          </li>
        </ul>

        <div class="welcome">
          <div class="img">
             <img src="/fonts/Ellipse.svg" alt="profile">
          </div>
          <div class="details">
            <h4>Code Noob</h4>
            <p>Teacher</p>
          </div>

          <!-- <div class="icon">V</div> -->
        </div>
      </div>
    </nav>
  </header>
 <main>
    <div class="landing">
      <div class="left-img">
          <img src="/fonts/graduant (1).svg" alt="">               
      </div>
      <div class="landing-text">
        <p>Hi, <span>Code Noob</span></p>
        <h2>Welcome to Asclepius Class</h2>
        <p>All about classroom activities would be updated here</p>
      </div>
    </div>

    <section class="flex">
      <div class="teacher-section">
        <div class="class-note">
          <h4>Class Notes</h4>
          <div class="card-sec">
            <div class="note-img">
                <svg width="7" height="9" viewBox="0 0 7 9" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                  <path d="M0.784142 0.547703H6.7764V8.23925H0.784142V0.547703Z" fill="#C4C4C4"/>
                  <path d="M0.784142 0.547703H6.7764V8.23925H0.784142V0.547703Z" fill="url(#pattern0)"/>
                  <path d="M0.784142 0.547703H6.7764V8.23925H0.784142V0.547703Z" fill="url(#pattern1)"/>
                  <path d="M0.784142 0.547703H6.7764V8.23925H0.784142V0.547703Z" fill="url(#pattern2)"/>
                  <defs>
                  <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                  <use xlink:href="#image0" transform="translate(-0.141791) scale(0.00570481 0.00444444)"/>
                  </pattern>
                  <pattern id="pattern1" patternContentUnits="objectBoundingBox" width="1" height="1">
                  <use xlink:href="#image1" transform="translate(-0.141791) scale(0.00570481 0.00444444)"/>
                  </pattern>
                  <pattern id="pattern2" patternContentUnits="objectBoundingBox" width="1" height="1">
                  <use xlink:href="#image2" transform="translate(-0.156246) scale(0.0057819 0.0045045)"/>
                  </pattern>
                  <image id="image0" width="225" height="225" xlink:href="data:image/png;base64,"/>
                  <image id="image1" width="225" height="225" xlink:href="data:image/jpeg;base64,"/>
                  <image id="image2" width="227" height="222" xlink:href="data:image/png;base64,"/>
                  </defs>
                  </svg>                  
            </div>
            <div class="note-content">
              <p>Create Class Notes</p>
            </div>
          </div>
        </div>

        <div class="assign">
          <h4>Assignment</h4>
          <div class="card-sec">
              <div class="assign-img">
                  <img src="/fonts/Ellipse 5.svg" alt="">               
              </div>
              <div class="assign-content">
                <p>Create Assignments</p>
              </div>
            </div>
        </div>
        
      </div>
      <div class="calender">
        <div class="line"></div>
          <h3 id="monthAndYear"></h3>
        <table class="table table-bordered" id="calendar">
            <thead>
            <tr>
                <th>Sun</th>
                <th>Mon</th>
                <th>Tue</th>
                <th>Wed</th>
                <th>Thu</th>
                <th>Fri</th>
                <th>Sat</th>
            </tr>
            </thead>

            <tbody id="calendar-body">

            </tbody>
        </table>
      </div>
    </section>
  </main>


  <script src="https://code.jquery.com/jquery-3.3.1.slim.min.js" integrity="sha384-q8i/X+965DzO0rT7abK41JStQIAqVgRVzpbzo5smXKp4YfRvH+8abtTE1Pi6jizo" crossorigin="anonymous"></script>
<script src="https://cdnjs.cloudflare.com/ajax/libs/popper.js/1.14.7/umd/popper.min.js" integrity="sha384-UO2eT0CpHqdSJQ6hJty5KVphtPhzWj9WO1clHTMGa3JDZwrnQq4sF86dIHNDz0W1" crossorigin="anonymous"></script>
<script src="https://stackpath.bootstrapcdn.com/bootstrap/4.3.1/js/bootstrap.min.js" integrity="sha384-JjSmVgyd0p3pXB1rRibZUAYoIIy6OrQ6VrjIEaFf/nJGzIxFDsf4x0xIM+B07jRM" crossorigin="anonymous"></script>
  <script src="/js/calendar.js"></script>
</body>

</html>